import React from 'react'

const ShowInfo = ({band, genreName, year}) => {

    return(
       <>
       <p id="info" style={{display:'none'}} key={`key_${band.genreCode}`}>{genreName+1} - {year.year}</p>
       </>
    )
}

export default ShowInfo;
